import axios from 'axios';

const App = () => (
    <div>
        <h1>ROBOFRIENDS</h1>
        <input type='text'></input>
    </div>
);

App.getInitialProps = async function() {
    const response = await axios.get('https://jsonplaceholder.typicode.com/users');
    const data = await response.json();
    console.log(data);
    return {data};
}

export default App;
